‚ñ† Ha ho lihlahisoa tse sa hulang pampiri, ha ho pampit≈°ana e sa hulang mabokose;
‚ñ† Ho jarolla sehlahisoa ho hatelloa ha sehlahisoa se le sieo kapa se sa nepahala, mochini o emisa ka bo ona ha sehlahisoa se kentsoe ka tsela e sa nepahalang ka lebokoseng;
‚ñ† Mochini o ikemela ka bo oona ha ho se na mabokose kapa pampiri e sa fumanoeng;
‚ñ† Ho bonolo ho fetola lihlahisoa ka litlhaloso tse fapaneng;
‚ñ† mosebetsi o moholo oa ts'ireletso bakeng sa polokeho ea mosebelisi
